WordPress has a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'Hei!

WordPress har en innebygget funksjon som oppdager når en utvidelse eller et tema forårsaker en fatal feil med nettstedet ditt, og varsler deg med denne e-posten automatisk.
###CAUSE###
Besøk først nettstedet ditt  (###SITEURL###) og sjekk om du kan se noen synlige problemer. Gå deretter til siden der feilen ble oppdaget (###PAGEURL###)  og se etter synlige problemer.

###SUPPORT###

Hvis nettstedet ditt ikke ser ut til å fungere og du ikke kommer deg inn i kontrollpanelet som normalt, har WordPress nå en gjenopprettelsesmodus som lar deg logge inn i kontrollpanelet for å undersøke videre.

###LINK###

For å holde nettstedet ditt sikkert vil denne lenken bare fungere i ###EXPIRES###. Men ikke bekymre deg om det - skjer feilen igjen etter at lenken utløper så vil du få tilsendt en e-post med en ny lenke.

Om du søker hjelp med dette problemet kan du bli bedt om noe av følgende informasjon: 
