 a valid property of Object.'=>'%1$s er ikke en gyldig egenskap for Objekt.','You will not be able to install new themes from here yet since your install requires SFTP credentials. For now, please <a href="%s">add themes in the admin</a>.'=>'Du vil ikke kunne installere nye temaer herfra, siden installasjonen din krever SFTP-autentisering. For øyeblikket kan du legge til temaer fra <a href="%s">administrasjonssiden</a>.','categoriesMost Used'=>'Mest brukte','tagsMost Used'=>'Mest brukte','Click &#8220;Next&#8221; to start adding links to your new menu.'=>'Klikk &#8220;Neste&#8221; for å begynne å legge til lenker i den nye menyen din.','customizer changeset action/button labelSchedule'=>'Planlegg','+ Create New Menu'=>'+ Opprett ny meny','Create a menu for this location'=>'Opprett en meny for denne plasseringen','Could not open handle for %1$s to %2$s.'=>'Kunne ikke åpne filhåndtak for %1$s til %2$s.','Add a navigation menu to your sidebar.'=>'Legg til en navigasjonsmeny i kolonnen.','%s has taken over and is currently customizing.'=>'%s har tatt over og holder på å tilpasse.','Looks like something&#8217;s gone wrong. Wait a couple seconds, and then try again.'=>'Det ser ut som at noe har gått galt. Vent noen sekunder og prøv igjen.','Take over'=>'Ta over','Go back'=>'Gå tilbake','%s is already customizing this site. Please wait until they are done to try customizing. Your latest changes have been autosaved.'=>'%s tilpasser allerede dette nettstedet. Vent til personen er ferdig. Dine siste endringer har blitt autolagret.','%s is already customizing this site. Do you want to take over?'=>'%s tilpasser allerede denne siden. Vil du ta over?','Sorry, you are not allowed to take over.'=>'Beklager, du har ikke tilgang til å ta over.','No changeset found to take over'=>'Fant ingen endringssett å ta over','Security check failed.'=>'Sikkerhetssjekk feilet','Changeset is being edited by other user.'=>'Endringssettet redigeres av en annen bruker.','menu locationsHere&#8217;s where this menu appears. If you would like to change that, pick another location.'=>'Dette er der menyen din dukker opp. Hvis du vil endre det, velg en annen plassering.','menu locations(If you plan to use a menu <a href="%1$s" %2$s>widget%3$s</a>, skip this step.)'=>'(Hvis du planlegger å bruke en meny-<a href="%1$s" %2$s>widget%3$s</a>, hopp over dette trinnet.)','menu locationsWhere do you want this menu to appear?'=>'Hvor vil du at menyen skal vises?','You&#8217;ll create a menu, assign it a location, and add menu items like links to pages and categories. If your theme has multiple menu areas, you might need to create more than one.'=>'Du vil lage en meny, tildele den en lokasjon og legge til menyelementer, som lenker til sider og kategorier. Hvis temaet ditt har flere menylokasjoner må du kanskje lage mer enn en.','It does not look like your site has any menus yet. Want to build one? Click the button to start.'=>'Det ser ikke ut som om nettstedet ditt har noen menyer ennå. Vil du lage en? Klikk knappen for å begynne.','menu locationsView All Locations'=>'Vis alle lokasjoner','While previewing a new theme, you can continue to tailor things like widgets and menus, and explore theme-specific options.'=>'Når du forhåndsviser et tema kan du fortsette å tilpasse ting som widgeter og menyer, og utforske innstillinger spesifikt for temaet.','Looking for a theme? You can search or browse the WordPress.org theme directory, install and preview themes, then activate them right here.'=>'Ser du etter et tema? Du kan søke etter og bla gjennom temakatalogen på WordPress.org, installere og forhåndsvise temaer, og så aktivere dem her.','menu locationsView Location'=>'Vis lokasjon','No themes found. Try a different search.'=>'Ingen temaer funnet. Prøv et annet søk.','Your theme can display menus in one location. Select which menu you would like to use.'=>'Temaet ditt kan vise menyer på en lokasjon. Velg hvilken meny du vil bruke.','Site Name: %s'=>'Navn på nettsted: %s','%