###SITEURL###','<strong>Error:</strong> The email address is already used.'=>'<strong>Feil:</strong> Denne e-postadressen er allerede i bruk.','&larr; Go to Categories'=>'&larr; Gå til kategorier','&larr; Go to Link Categories'=>'&larr; Gå til til lenkekategorier','Sorry, you cannot preview new themes when you have changes scheduled or saved as a draft. Please publish your changes, or wait until they publish to preview new themes.'=>'Beklager, du kan ikke forhåndsvise nye temaer når du har planlagt endringer eller lagret som et utkast. Publiser endringene dine, eller vent til de blir publisert for å forhåndsvise nye temaer.','Schedule your customization changes to publish ("go live") at a future date.'=>'Planlegg dine tilpasningsendringer for publisering ("gå live") på en fremtidig dato.','Homepage and posts page must be different.'=>'Forside og innleggsside må være forskjellig.','There is %d error which must be fixed before you can save.'=>'Det er %d feil som må fikses før du kan lagre.' . "\0" . 'Det er %d feil som må fikses før du kan lagre.','There is a more recent autosave of your changes than the one you are previewing. <a href="%s">Restore the autosave</a>'=>'Det er en nyere automatisk lagret versjon av endringene dine enn den du forhåndsviser.  <a href="%s">Gjenopprett automatisk lagret versjon</a>','Are you sure you want to discard your unpublished changes?'=>'Er du sikker på at du vil forkaste de ikke-publiserte endringene dine?','Reverting unpublished changes&hellip;'=>'Tilbakestiller ikke-publiserte endringer&hellip;','Setting up your live preview. This may take a bit.'=>'Klargjør forhåndsvisningen. Dette kan ta litt tid.','Downloading your new theme&hellip;'=>'Laster ned ditt nye tema&hellip;','Discard changes'=>'Forkast endringer','Please save your changes in order to share the preview.'=>'Lagre endringene dine for å dele forhåndsvisningen.','Updating'=>'Oppdaterer','Draft Saved'=>'Kladd lagret','Activate &amp; Publish'=>'Aktiver og publiser','Yiddish'