###SITEURL###','Only UUID V4 is supported at this time.'=>'Bare UUID V4 er støttet på dette tidspunktet.','The Press This plugin is required.'=>'Press This-utvidelsen kreves.','%s themes'=>'%s temaer','Filter themes (%s)'=>'Filtrer temaer (%s)','Go to theme sources'=>'Gå til temakilder','Search WordPress.org themes'=>'Søk i WordPress.org-temaer','Install &amp; Preview'=>'Installer og forhåndsvis','Invalid URL.'=>'Ugyldig URL.','Time to add some links! Click &#8220;%s&#8221; to start putting pages, categories, and custom links in your menu. Add as many things as you would like.'=>'På tide å legge til noen lenker! Klikk &#8220;%s&#8221; for å begynne å legge til sider, kategorier, og egendefinerte lenker i menyen. Legg til så mange ting du vil.','Choose image'=>'Velg bilde','Choose audio'=>'Velg lyd','Change audio'=>'Endre lyd','Select audio'=>'Velg lyd','Click &#8220;Add Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header height of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Klikk &#8220;Legg til bilde&#8221; for å laste opp en bildefil fra datamaskinen din. Temaet ditt virker best med et bilde med en høyde for sidetopen på %s piksler &#8212; og du vil kunne beskjære bildet ditt etter at du har lastet det opp, for å sikre at det passer perfekt.','Click &#8220;Add Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header width of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Klikk &#8220;Legg til bilde&#8221; for å laste opp en bildefil fra datamaskinen din. Temaet ditt virker best med et bilde med en bredde for sidetoppen på %s piksler &#8212; og du vil kunne beskjære bildet ditt etter at du har lastet det opp, for å sikre at det passer perfekt.','Click &#8220;Add Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header size of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Klikk &#8220;Legg til bilde&#8221; for å laste opp en bildefil fra datamaskinen din. Temaet ditt virker best med et bilde med en størrelse for sidetoppen på %s piksler &#8212; og du vil kunne beskjære bildet ditt etter at du har lastet det opp, for å sikre at det passer perfekt.','Click &#8220;Add Image&#8221; to upload an image file from your computer. Your theme works best with an image that matches the size of your video &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Klikk &#8220;Legg til bilde&#8221; for å laste opp en bildefil fra datamaskinen din. Temaet ditt virker best med et bilde som passer til størrelsen på videoen din &#8212; og du vil kunne beskjære bildet ditt etter at du har lastet det opp, for å sikre at det passer perfekt.','%1$s-%2$s'=>'%1$s-%2$s','Meridian'=>'meridian','Minute'=>'Minutt','Hour'=>'Time','Time'=>'Tid','Day'=>'Dag','Month'=>'Måned','Date'=>'Dato','Usage of user levels is deprecated. Use capabilities instead.'=>'Bruk av brukernivåer er foreldet. Bruk tilganger istedet.','The theme defines itself as its parent theme. Please check the %s header.'=>'Temaet ditt definerer seg selv som foreldertema. Sjekk hodelinjen %s.','Name for the Visual editor tabVisual'=>'Visuell','Create New Menu'=>'Opprett ny meny','New Menu'=>'Ny meny','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'Hvis temaet ditt har widgetområder kan du også legge til menyer der. Gå til <a href="%s">Widget-panelet</a> og legg til en &#8220;Navigasjonsmeny-widget&#8221; for å vise en meny i en sidelinje eller bunntekst.','If your theme has multiple menus, giving them clear names will help you manage them.'=>'Hvis temaet ditt har flere menyer vil det hjelpe deg å holde styr på dem hvis du gir de  tydelige navn.','Your theme can display menus in %s location.'=>'Temaet ditt kan vise menyer på %s lokasjon.' . "\0" . 'Temaet ditt kan vise menyer på %s lokasjoner.','Your theme can display menus in one location.'=>'Temaet ditt kan vise menyer på ett sted.','CSS code'=>'CSS-kode','The edit field automatically highlights code syntax. You can disable this in your <a href="%1$s" %2$s>user profile%3$s</a> to work in plain text mode.'=>'Redigeringsfeltet vil automatisk fremheve kodesyntaks. Du kan slå av dette i dine <a href="%1$s" %2$s>brukerinnstillinger%3$s</a> for å arbeide med ren tekst.','Screen reader users: when in forms mode, you may need to press the Esc key twice.'=>'Skjermleserbrukere: når du er i skjemamodus må du kanskje trykke Esc-knappen to ganger.','To move away from this area, press the Esc key followed by the Tab key.'=>'For å flytte vekk fra dette området, trykk Esc-knappen fulgt av Tab.','In the editing area, the Tab key enters a tab character.'=>'I redigeringsområdet vil Tab-knappen sette inn et tab-tegn.','When using a keyboard to navigate:'=>'Når du bruker et tastatur for å navigere:','Add your own CSS code here to customize the appearance and layout of your site.'=>'Legg til din egen CSS-kode her for å tilpasse utseendet og oppsettet på nettstedet ditt.','Your homepage displays'=>'Forsiden din viser','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two Pages. One will become the homepage, and the other will be where your posts are displayed.'=>'Du kan velge hva som skal vises på forsiden på nettstedet ditt. Det kan være innlegg i omvendt kronologisk rekkefølge (klassisk blogg) eller en fastsatt/statisk side. For å sette en statisk forside må du først lage to sider. Én vil bli forsiden, og den andre vil bli der innleggene dine vises.','Homepage Settings'=>'Forsideinnsti