rnately, try out the new &#8220;Custom HTML&#8221; widget!'=>'Hei der! Det ser ut som du akkurat limte inn HTML i fanen «Visuell» i tekst-widgeten. Det kan hende du heller vil lime inn koden i fanen «Kode» i stedet. Alternativt kan du prøve den nye widgetet «Egendefinert HTML»!','Did you just paste HTML?'=>'Limte du akkurat inn HTML-kode?','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by scanning the list of available widgets on this screen. Check it out to add some custom code to your site!'=>'Hei, har du hørt at vi har en widget for &#8220;Egendefinert HTML&#8221; nå? Du finner den ved å se på listen over tilgjengelige widgeter på denne skjermen. Prøv den for å legge til egendefinert på nettstedet ditt!','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by pressing the &#8220;<a class="add-widget" href="#">Add a Widget</a>&#8221; button and searching for &#8220;HTML&#8221;. Check it out to add some custom code to your site!'=>'Hei, har du hørt at vi har en widget for «Egendefinert HTML» nå? Du finner den ved å trykke på knappen «<a class="add-widget" href="#">Legg til en widget</a>» og søke etter «HTML». Prøv den for å legge til egendefinert kode på nettstedet ditt!','New Custom HTML Widget'=>'Ny widget for egendefinert HTML','This widget may contain code that may work better in the &#8220;Custom HTML&#8221; widget. How about trying that widget instead?'=>'Denne widgeten kan inneholde kode som fungerer bedre i den nye widgeten «Egendefinert HTML». Hva med å prøve den isteden?','Arbitrary text.'=>'Vilkårlig tekst.','Some HTML tags are not permitted, including:'=>'Noen HTML-elementer er ikke tillatt, inkludert:','Custom HTML'=>'Egendefinert HTML','Arbitrary HTML code.'=>'Vilkårlig HTML-kode.','Show tag counts'=>'Vis antall','%s item'=>'%s element' . "\0" . '%s elementer','label for button in the media widgetAdd Media'=>'Legg til media','label for button in the video widgetAdd Video'=>'Legg til video','l